import React from "react";
import { Navbar } from "react-bootstrap";
import { Nav } from "react-bootstrap";
// import {NavDropdown} from 'react-bootstrap';
// import { Container, Row, Col, Alert} from "react-bootstrap";
import { Container } from "react-bootstrap";
function NavBar() {
  return (
    <body>
      <div className="mainnavbar ">
        {/* <Container fluid="md">
        <Row >
          <Col className="mt-1">
            Get the App
          </Col>
        </Row>
      </Container>
      <Alert  variant="warning">
    This is a  alertâ€”check it out!
    <Alert.Link href="#">an example link</Alert.Link>
  </Alert> */}
        <Navbar expand="lg">
          <Container>
            <Navbar.Brand className="mt-1" href="#">
              Get the App
            </Navbar.Brand>
            <Nav className="mr-auto links">
              <Nav.Link className="links0" href="#home">Add Restaurant</Nav.Link>
              <Nav.Link className="links0" href="#features">Log in</Nav.Link>
              <Nav.Link href="#features">Signup</Nav.Link>
            </Nav>
          </Container>
        </Navbar>
      </div>
    </body>
  );
}
export default NavBar;
